import React from "react";
import Car from "./car";

interface CardsProps {
  IDs: number[];
  page: number;
  selectCurrency: Function;
  currency: string;
  carBrand: string;
}

function Cards(props: CardsProps) {
  function getElementsPerPage(
    array: any[],
    pageNumber: number,
    elementsPerPage: number
  ): any[] {
    const startIndex: number = (pageNumber - 1) * elementsPerPage;
    const endIndex: number = startIndex + elementsPerPage;

    return array.slice(startIndex, endIndex);
  }

  return (
    <div className="cards">
      {getElementsPerPage(
        props.IDs.map((ID: number) => (
          <Car
            carBrand={props.carBrand}
            id={ID}
            selectCurrency={props.selectCurrency}
            currency={props.currency}
          />
        )),
        props.page,
        5
      )}
    </div>
  );
}

export default Cards;
